{
 "description": "Describes an intention to create a tunnel between the current cluster and the target cluster. This would allow the current cluster to access the target cluster through the tunnel  (assuming that the current cluster does not have direct access to the target cluster).",
 "properties": {
  "spec": {
   "properties": {
    "gatewayRef": {
     "description": "A reference to the `TunnelGateway` object which describes how various services would be exposed outside the current cluster.",
     "properties": {
      "name": {
       "description": "Name of the referent. More info: https://kubernetes.io/docs/concepts/overview/working-with-objects/names/#names TODO: Add other useful fields. apiVersion, kind, uid?",
       "type": "string"
      }
     },
     "type": "object"
    },
    "proxyPort": {
     "description": "The port for the tunnel proxy.",
     "format": "int32",
     "type": "integer"
    }
   },
   "type": "object"
  }
 },
 "title": "Tunnel Connector",
 "type": "object"
}
